description:
Live and Back on Nights

Arts Documentary hosted by Peter Kay, published by Channel 4 in 2014 - English narration


Information
------------------------------

Peter gives viewers a unique look behind the scenes of his mammoth 18 months on the road. Playing 140 shows to 1.2 million people, Peter Kay: Live and Back On Nights! also includes brand new material from what is the biggest and most successful stand-up comedy tour of all time.

